function inicia1(){
  for (var i=0;i<arrAnios.length;i++){
	$('#' + arrAnios[i].anio).hide();
  }
  for (var i=0;i<arrConcursos.length;i++){
	$('#' + arrConcursos[i][2]).hide();
  }
  for (var i=0;i<arrAnios.length;i++){
	$('#btn' + arrAnios[i].anio).click(function(){
	  for (var j=0; j<arrAnios.length; j++){
		if (arrAnios[i].anio != arrAnios[j].anio){
		  $('#' + arrAnios[j].anio).hide();
		}
		else {
		  $('#' + arrAnios[j].anio).show();
		}
	  }
	});
  }
  for (var i=0;i<arrConcursos.length;i++){
	$('#' + arrConcursos[i][2]).click(function(){
	  if ($('#' + arrConcursos[i][2]).is (':hidden')){
		for (j=0; j<arrConcursos.length; j++){
		  if (arrConcursos[i][2] != arrConcursos[j][2]){
			$('#' + arrConcursos[j][2]).hide();
		  }
		  else {
			$('#' + arrConcursos[j][2]).show();
		  }
		}
	  }
	  else{
		$('#' + arrConcursos[i][2]).hide();
	  }
	});
  }
}

function crearPodium(anio){
	arrSocios.sort(function (a, b){
	  return a.nombre.localeCompare(b.nombre);
	});

	var arrPuntos = [];
	for (var i=0; i<arrSocios.length; i++){
	  if ((arrSocios[i].anio==anio)&&(arrSocios[i].activo)){
		var nuevo = {socio:arrSocios[i].socio,nombre:arrSocios[i].nombre,puntosnacional:0.00,puntosregional:0.00};
		arrPuntos.push(nuevo);
	  }
	}
	for (var i=0;i<arrPuntos.length;i++){
	  for (var j=0;j<arrCarreras.length;j++){
		if ((arrPuntos[i].socio==arrCarreras[j][8])&&(arrCarreras[j][0] == anio)){
		  if (arrCarreras[j][1].charAt(arrCarreras[j][1].length-2)=='N'){
			arrPuntos[i].puntosnacional += arrCarreras[j][13];
		  }
		  else{
			arrPuntos[i].puntosregional += arrCarreras[j][13];
		  }
		}
	  }
	}
	arrPuntos.sort(function (a, b) {
	  //return a.nombre.localeCompare(b.nombre);
	  return b.puntosnacional - a.puntosnacional;
	});
	
	var htmlPuntos = "";
	htmlPuntos+="<div id='nacional" + anio + "'>";
	htmlPuntos+="<table id='tablepodium'" + anio +" class='table table-striped'>";
	htmlPuntos+="<thead><tr><th class='dcha'>Nº</th><th class='izqda'>Socio</th><th class='dcha'>Puntos</th></tr></thead>";
	htmlPuntos+="<tbody>";
	for (var i=0; i<arrPuntos.length; i++){
	  htmlPuntos+="<tr>";
	  htmlPuntos+="<th scope='row' class='dcha'>" + (i+1) +"</th>";
	  htmlPuntos+="<td class='izda'>" + arrPuntos[i].nombre + "</td>";
	  htmlPuntos+="<td class='dcha'>" + Number(arrPuntos[i].puntosnacional).toFixed(2) + "</td>";
	  htmlPuntos+="</tr>";
	}
	htmlPuntos+="</tbody>";
	htmlPuntos+="</table>";
	htmlPuntos+="</div>";
	
	arrPuntos.sort(function (a, b) {
	  //return a.nombre.localeCompare(b.nombre);
	  return b.puntosregional - a.puntosregional;
	});
	htmlPuntos+="<div id='regional" + anio + "'>";
	htmlPuntos+="<table id='tablepodium'" + anio +" class='table table-striped'>";
	htmlPuntos+="<thead><tr><th class='dcha'>Nº</th><th class='izqda'>Socio</th><th class='dcha'>Puntos</th></tr></thead>";
	htmlPuntos+="<tbody>";
	for (var i=0; i<arrPuntos.length; i++){
	  htmlPuntos+="<tr>";
	  htmlPuntos+="<th scope='row' class='dcha'>" + (i+1) +"</th>";
	  htmlPuntos+="<td class='izda'>" + arrPuntos[i].nombre + "</td>";
	  htmlPuntos+="<td class='dcha'>" + Number(arrPuntos[i].puntosregional).toFixed(2) + "</td>";
	  htmlPuntos+="</tr>";
	}
	htmlPuntos+="</tbody>";
	htmlPuntos+="</table>";
	htmlPuntos+="</div>";

  return htmlPuntos;
}
